async function lonifyCarpVersusOffi(speci1, speci2){
	const licarp = lignifyNormalGares(convertGares(await fileFetch(speci1), speci1), speci1, lineInfo); /* lignified gares */
	const gjoffi = await fileFetch(speci2); /* gjoffi */
	console.log(" --- start --- AWAIT / ASYNC framework");
	consoledotlog(metaAnalysis(gjcarp));
	consoledotlog(metaAnalysis(gjoffi));
	const liclone = gjcarp.features.filter(f => !(gjoffi.features.find(g => g.properties.num === f.properties.num)));
	const caloneGeojson = updataGeojson(gjcarp, liclone, {"doc":"calone", "nbfeatures":liclone.length});
	consoledotlog(`============ lonifyCarpVersusOffi>`, metaAnalysis(caloneGeojson));
	console.log(" --- end --- AWAIT / ASYNC framework");
	saveSync(JSON.stringify(caloneGeojson));
}



